import React from 'react';

function Movie(props) {
    return (
        <div>
            <img src={props.image1} alt={props.title} />
            <img src={props.image2} alt={props.title} />
            <img src={props.image3} alt={props.title} />
            <h3>{props.title}</h3>
        </div>
    );
}

export default Movie;
